import React, {Component} from 'react';
import './style.css'
import profileImg from './img/img.jpg';

class Home extends Component {
  render() {
    return (
      <div className="Intro">
        <div>
          <div>
            Hi, I'm Jingxing(Cyrus) Gao
          </div>
          <div>
            xxx
          </div>
        </div>
        {/*<div style={{width: "20px", height: "20px"}}/>*/}
        <div style={{width: "200px", height: "200px"}}>
          <img src={profileImg} alt="" style={{width: "100%", borderRadius: "30%", border: "2px solid rgb(100,100,100)", padding: "2px"}}/>
        </div>
      </div>
    );
  }
}

export default Home;
